import React from 'react';
import styled from 'styled-components';
import InlineBox from './InlineBox.js';

import '../../Nav/GlobalNav.js';
import SubTitles from '../SubTitle.js';
import Browser from '../../../img/browser.svg';

import ShoppingBag from '../../../img/ShoppingBag.svg';





const Container = styled.div`
    width: 483px;
    height: 370px;
    padding: 45px 40px;
    margin-right: 30px;
    position: relative;
    background: #87BBFD;
    position: relative;
    border-radius: 8px;
    img{
        width: 510px;
        position: absolute;
        top: 0;
        right: 0;
    }
`
const InContainer = styled.div`
    width: 403px;
    height: 242px;
    padding: 20px;
    position: absolute;
    bottom: 0px;
    background: #fff;
`

const TitleBox = styled.div`
    text-align: center;
    img{
       width: 24px;
       height: 24px;
       color: #fff;
       position: absolute;
       top: 42px;
        left: 32%;

   }
   h3{
       color: #fff;
       margin-top: 0;
       text-transform: uppercase;
   }
`

class ImageCheckout extends React.Component {
  render(){
    return (
        <Container>
            <img src={Browser} alt="back"/>
            <TitleBox><img src={ShoppingBag} alt="back"/><SubTitles title="checkout"/></TitleBox>
            <InlineBox/>
            <InContainer>

            </InContainer>
        </Container>
    );
  }
}
export default ImageCheckout;
